Actionscript.script:
onClipEvent(enterFrame){
   var 实际移动距离 = _root.技能函数.小跳移动距离计算("后跳", _parent._parent.技能等级, _parent._parent.重量, _parent._parent.等级);
   _parent.攻击时后退移动(实际移动距离, 实际移动距离);
}
onClipEvent(load){
   if(Key.isDown(_parent._parent.上键))
   {
      _parent.上下跳移动方向 = "上";
      _parent.gotoAndPlay("上下跳");
   }
   else if(Key.isDown(_parent._parent.下键))
   {
      _parent.上下跳移动方向 = "下";
      _parent.gotoAndPlay("上下跳");
   }
   if(_parent._parent.方向 == "右")
   {
      if(Key.isDown(_parent._parent.右键) == true)
      {
         _parent.gotoAndPlay("前跳");
      }
   }
   else if(_parent._parent.方向 == "左")
   {
      if(Key.isDown(_parent._parent.左键) == true)
      {
         _parent.gotoAndPlay("前跳");
      }
   }
}

onClipEvent(enterFrame){
	if(!_parent.上下跳移动方向){
		if(random(2)==0){
			_parent.上下跳移动方向 = "上";
		}else{
			_parent.上下跳移动方向 = "下";
		}
	}
   var 实际移动距离 = _root.技能函数.小跳移动距离计算("上下跳", _parent._parent.技能等级, _parent._parent.重量, _parent._parent.等级);
   _parent._parent.移动(_parent.上下跳移动方向, 实际移动距离);
   _parent.攻击时移动(0, 实际移动距离);
}

onClipEvent(enterFrame){
   var 实际移动距离 = _root.技能函数.小跳移动距离计算("前跳", _parent._parent.技能等级, _parent._parent.重量, _parent._parent.等级);
   _parent.攻击时移动(实际移动距离, 实际移动距离);
}

onClipEvent (load) {
	_parent._parent.skillShadow = this;
	if (!_root.是否阴影)
	{
		this._visible = false;
	}
	缩放乘数 = 3.611 * 175 / _parent._parent.身高;
	if (_parent._parent.技能浮空 == true)
	{
		if (_parent._parent.浮空)
		{
			this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
		}
	}
}
onClipEvent (enterFrame) {
	if (_root.是否阴影 && !_parent.落地)
	{
		this._y = 233.05 + (_parent._parent.起始Y - _parent._parent._y - _parent._parent.垂直速度) * 缩放乘数;
	}
	else
	{
		this._y = 233.05;
	}
}
